    if (ship.custom.page === 'shiptree') pages.shiptree.hide(ship, ship.custom.layout);
    [hideScreen, defaultScreen].forEach(_ => _.hideAll(ship, ship.custom.layout));
    return announcement(ship, 'You were put in timeout.');
